CREATE TABLE ct_stocks
(
   stock_id      int 	           primary key auto_increment,
   symbol        varchar(40)       NOT NULL UNIQUE,
   bid			 decimal(10,4),
   ask           decimal(10,4),
   day_high     decimal(10,4),
   day_low       decimal(10,4)
);
