CREATE TABLE `sequence` (
  `SEQ_NAME` varchar(50) NOT NULL,
  `SEQ_COUNT` decimal(38,0) DEFAULT NULL,
  PRIMARY KEY (`SEQ_NAME`)
) ;

INSERT INTO `sequence` VALUES ('SEQ_GEN',10);



CREATE TABLE ct_trades
(
   trade_id        int 	   primary key auto_increment,
   trader_id       int,
   stock_id        int,
   algo_id         int,
   order_id        int,
   trade_type      varchar(50),
   num_shares      decimal(20,4)	 NOT NULL DEFAULT 0.00,
   price_pershare  decimal(20,4)     NOT NULL DEFAULT 0.00,
   profit_lost     decimal(20,4)     NOT NULL DEFAULT 0.00,
   FOREIGN KEY(trader_id) REFERENCES ct_users(user_id),
   FOREIGN KEY(stock_id)  REFERENCES ct_stocks(stock_id),
   FOREIGN KEY(algo_id)  REFERENCES ct_algorithms(algo_id),
   foreign key(order_id) REFERENCES ct_orders(order_id)
);

